gGe(){return"About the Application"},
gSP(){return"If you have further questions please contact:"},
gGf(){return"About Helios"},
gSQ(){return"This application is developed as a part of a master thesis at NTNU. The aim of the thesis is to research the effects of digital technology in a citizen engagement process. Citizen engagement is a democratic process where governments or project owners share information related to a project or technologies, with the aim of educating the public and gather feedback with the citizen's unique perspective. This project uses information produced by Helios on solar technology and aims for citizens of M\xf8llenberg."},
gSR(){return"Helios is a project ran by NTNU's Faculty of Engineering. The aim of the project is enhancing optimal exploitation of solar energy in Nordic cities through the digitalization of the built environment. The historic area of M\xf8llenberg is a special focus of research. This is because the heritage buildings introduces unique challenges related to sustainable conservation and development of historical areas."},
gGj(){return"Integration"},
gTQ(){return"Community Shared Ownership"},
gTR(){return"Compare"},
gkl(){return"Configuration"},
gUI(){return"North East"},
gUJ(){return"South West"},
gUY(){return"East"},
gHv(){return"Ownership Models"},
gUZ(){return"Most of the buildings in M\xf8llenberg are apartments in a co-ownership or in a housing association (Eiendomsprofil, 2022). Therefore, a collective investment is the most realistic way to acquire solar energy solution.  The profitability of solar modules are tied both to the value generated by the modules as well as whatever equipment it replaces. In order to maximize the profitability of solar technology, the product should be installed as a part of a building's regular maintenance schedule. If the solar panels live for up to 40 years, this means that in M\xf8llenberg, multiple owners of the same building/apartment, could use the same panels.  Energy saving will differ for one investment to another. This is a result of different variables such as location, radiation, weather, lifetime, size, product, energy prices, inflation and more."},
gHw(){return"Calculator"},
gV1(){return"Estimated energy in kw/h"},
gzU(){return"Energy Storage"},
gV6(){return"Lithium-ion batteries come with some safety risks, fire and explosion being the most problematic cases. These issues are mainly related to a deterioration of the components forming the battery and the possible unwanted electrochemical reactions. However, it can also be due to the environment conditions like high temperatures or humidity and to human errors such as poor maintenance of the batteries, water immersion or dropping it causing an impact."},
gV7(){return"Among the energy storage systems the battery has received a lot of attention worldwide, especially the lithium-ion batteries as they offer high energy density, low maintenance and can be recharged hundreds of times. The working principle of the Lithium-Ion batteries is the transmission of Li+ ions from the positive electrode to the negative one creating an electric current. The low cost and versatility make the Li-ion batteries the first choice to power portable electronic devices such as mobile phones and are also used in battery energy storage systems (BESS) to keep the surplus of energy generation from solar and wind. The shelf life of the batteries is predicted to be between 3 and 6 years, as the rate at which they deteriorate is 2-5% per month the Li-ion batteries have to be replaced more frequently than other energy storage systems. To install them as a storage unit costs from 70 000 and 300 000 NOK."},
gV8(){return"Installing battery banks in M\xf8llenberg, mainly made of wood, is increasing the possibilities of damaging the buildings, endangering the cultural heritage. It is therefore not a suitable option for this specific neighbourhood."},
gV9(){return"Because the electricity generation of solar energy is unreliable on a day-to-day basis, an efficient storage technique is necessary. The houses being built of mostly wood requires an extra level of concern. Three ways of storing energy will be presented and discussed:"},
gVa(){return"Battery"},
gVb(){return"Pumped Hydro Storage"},
gVc(){return"Thermal Storage"},
gVd(){return"Pumped Hydro Storage (PHS) is a large-scale system that transports water from a lower reservoir to an upper one with the energy received and generates power again when needed letting the water move down again. PHS provides efficiency of 85% and represents 97% of the European Union\u2019s current energy storage facilities. Although being one of the cheapest with regard to cost per kilowatt-hour, 1000-1900 NOK/kWh, it has the highest construction cost. A hydroelectric system isn't difficult to operate and maintain, it has longevity and it's often more cost-effective than other forms of storage."},
gVe(){return"Norway being surrounded by large bodies of water has its energy demand provided by hydropower, the landscape is very favorable for this type of infrastructure. Norway already counts 10 pumped storage plants(PSP), one of them near Trondheim named Brattingfoss. This PSP cost 30 million euros to build and it\u2019s the first power plant in Norway set in operation in 1955. Pumped hydro technology is expensive to put in place, large amounts of money have to be invested in their construction. As there\u2019s an already existing pumped hydro facility no initial expense would be needed. This could be an interesting option to store the solar energy long term and from PV panels"},
gVf(){return"Thermal Energy Storage(TES) is a method that keeps energy by heating or cooling a storage medium. Most TES technologies can be readjusted to fit in solar applications. Each thermal storage approach has specific requirements regarding the temperature level, storage duration, structural system, cost and storage material properties among others. It is usually formed by one or more tanks containing the storage medium such as molten salts, packed bed or pressurised water. The cost of TES varies in function of the number of tanks, the medium and the space occupied, it ranges from 200 to 500 NOK/kWh."},
gVj(){return"Heritage buildings does not hold the same technological advantages as newer buildings. Older buildings are estimated to cause around 30% of solid waste production and 35 % of pollutant emissions. As these buildings consumes more electricity, they are responsible for about 39% of the world\u2019s energy consumption. The European Union is targeting the year 2050 to be a climate-neutral economy. To make this happen we need to produce energy in clean forms."},
gVk(){return"Norway gets a wast majority of its electricity from hydropower, but increasing electricity demands surpasses the hydro-potential. Other renewable sources have to be considered."},
