gYv(){return"B: High antequarian value"},
gYw(){return"C: Antequarian value"},
gYx(){return"Protected buildings constitute the majority of M\xf8llenberg. Most of the buildings have been given one form of protection degree as illustrated below. Byantikvaren, which are supposed to advise on the protection of cultural monuments and cultural environments, has made an assessment of the buildings in Trondheim. I this assessment three levels of protection ranging from A to C have been created. It also states which areas are to be classified as areas of consideration (Trondheim kommune, 2021)."},
gYy(){return"A conservation area can fit into one of three categories:"},
gJ8(){return"Guidelines"},
gYz(){return"In March 2018, Trondheim Municipality published a guide for the conservation area. The purpose of the guide is to be an aid to the residents in order to achieve the best possible management of the building stock. What applies to facade changes is also described for wooden buildings and brick buildings respectively. Overall, for all buildings, the original building parts must be taken care of and these must, as far as possible, be repaired. For wooden buildings, the city antiquarian recommends that the original cladding be preserved. The older cladding is high-quality wood and should therefore be preserved as far as possible, if it has to be replaced it must be similar cladding. In addition, all facade changes must be clarified with the city antiquary and applied for to the building records office (Byantikvaren, 2018)."},
gYA(){return"Roofs must be kept as they are and the original expression and detailing must be preserved. If the roof is to be replaced, the same roofing material must be used as is on the building today, it can also be changed back to the original roofing material. In case of improvement, the existing material must be relocated. It is, among other things, not possible to re-insulate as this could change the shape and character of the building. Changes to thatch material must also be clarified with the city antiquary and an application must be made to the building records office (Byantikvaren, 2018)."},
gJ9(){return"Protection Areas"},
gYB(){return"Ensure good management of buildings. Taking care of existing wooden structures."},
gYC(){return"Ensure good living conditions by reducing growth and lower area usage."},
gYD(){return"Ensure existing variation in building mass for residents and local businesses."},
gYE(){return"Ensure good flow of traffic and parking. Securing undeveloped areas for residents."},
gJa(){return"Zoning Plan"},
gYF(){return"The zoning plan for M\xf8llenberg is R0299 (Byantikvaren, 2018). R0299 is included in the guide for conservation from 1986 for M\xf8llenberg, Kirkesletten and Rosenborg. The goal of the guide can be described in four levels:"},
