gUZ(){return"De fleste bygningene i M\xf8llenberg er leiligheter i sameie eller i borettslag (Eiendomsprofil, 2022). Derfor er en kollektiv investering den mest realistiske m\xe5ten \xe5 anskaffe solenergil\xf8sning p\xe5. L\xf8nnsomheten til solcellemoduler er knyttet b\xe5de til verdien generert av modulene, s\xe5 vel som det utstyret det erstatter. For \xe5 maksimere l\xf8nnsomheten til solenergiteknologi, b\xf8r produktet installeres som en del av en bygnings vanlige vedlikeholdsplan. Dersom solcellepanelene lever i opptil 40 \xe5r, betyr det at i M\xf8llenberg kan flere eiere av samme bygg/leilighet bruke de samme panelene. Energisparing vil variere for en investering til en annen. Dette er et resultat av ulike variabler som plassering, str\xe5ling, v\xe6r, levetid, st\xf8rrelse, produkt, energipriser, inflasjon med mer."},
