gV1(){return"Estimert str\xf8m i kw/h"},
gzU(){return"Energilagring"},
gV6(){return"Litium-ion-batterier medf\xf8rer noen sikkerhetsrisikoer, brann og eksplosjon er de mest problematiske tilfellene. Disse problemene er hovedsakelig relatert til slitasje p\xe5 komponentene som danner batteriet og mulige u\xf8nskede elektrokjemiske reaksjoner. Det kan imidlertid ogs\xe5 skyldes milj\xf8forhold som h\xf8ye temperaturer eller luftfuktighet og menneskelige feil som d\xe5rlig vedlikehold av batteriene, nedsenking i vann eller \xe5 miste den og for\xe5rsake en st\xf8t."},
gV7(){return"Blant energilagringssystemene har batteriet f\xe5tt mye oppmerksomhet over hele verden, spesielt litium-ion-batteriene da de tilbyr h\xf8y energitetthet, lite vedlikehold og kan lades hundrevis av ganger. Arbeidsprinsippet til litium-ion-batterier er overf\xf8ring av Li+-ioner fra den positive elektroden til den negative som skaper en elektrisk str\xf8m. Den lave kostnaden og allsidigheten gj\xf8r Li-ion-batteriene til f\xf8rstevalget for \xe5 drive b\xe6rbare elektroniske enheter som mobiltelefoner og brukes ogs\xe5 i batterienergilagringssystemer (BESS) for \xe5 holde p\xe5 overskuddet av energiproduksjon fra sol og vind. Holdbarheten til batteriene er sp\xe5dd \xe5 v\xe6re mellom 3 og 6 \xe5r, ettersom hastigheten de forringes med er 2-5 % per m\xe5ned, m\xe5 Li-ion-batteriene skiftes ut oftere enn andre energilagringssystemer. \xc5 installere dem som lagringsenhet koster fra 70 000 til 300 000 NOK."},
gV8(){return"\xc5 installere batteribanker i M\xf8llenberg, hovedsakelig av tre, \xf8ker mulighetene for \xe5 skade bygningene, og sette kulturarven i fare. Det er derfor ikke et egnet alternativ for dette spesifikke nabolaget."},
gV9(){return"Elektrisitetsproduksjonen av solenergi er up\xe5litelig p\xe5 daglig basis, er en effektiv lagringsteknikk n\xf8dvendig. Husene som bygges for det meste av tre krever en ekstra grad av bekymring. Tre m\xe5ter \xe5 lagre energi p\xe5 vil bli presentert og diskutert:"},
gVa(){return"Batteri"},
gVb(){return"Pumpekraftverk"},
gVc(){return"Varmelagring"},
gVd(){return"Pumped Hydro Storage / Vannlagring (PHS) er et storskala system som transporterer vann fra et nedre reservoar til et \xf8vre med den mottatte energien og genererer str\xf8m igjen ved behov slik at vannet beveger seg ned igjen. PHS gir en effektivitet p\xe5 85 % og representerer 97 % av EUs n\xe5v\xe6rende energilagringsanlegg. Selv om den er en av de billigste med hensyn til kostnad per kilowatt-time, 1000-1900 kr/kWh, har den h\xf8yest byggekostnad. Et vannkraftsystem er ikke vanskelig \xe5 betjene og vedlikeholde, det har lang levetid og er ofte mer kostnadseffektivt enn andre former for lagring."},
gVe(){return"Norge er omgitt av store vannmasser har sitt energibehov levert av vannkraft, landskapet er sv\xe6rt gunstig for denne typen infrastruktur. Norge har allerede 10 pumpede lagringsanlegg (PSP), ett av dem ved Trondheim ved navn Brattingfoss. Denne PSP-en kostet 30 millioner euro \xe5 bygge, og det er det f\xf8rste kraftverket i Norge som ble satt i drift i 1955. Pumpet vannkraftteknologi er dyrt \xe5 f\xe5 p\xe5 plass, store mengder penger m\xe5 investeres i konstruksjonen. Siden det allerede finnes et pumpet vannkraftanlegg, vil det ikke v\xe6re n\xf8dvendig med noen innledende utgifter. Dette kan v\xe6re et interessant alternativ for \xe5 lagre solenergien."},
gVf(){return"Termisk energilagring (TES) er en metode som holder energi ved \xe5 varme eller kj\xf8le et lagringsmedium. De fleste TES-teknologier kan justeres for \xe5 passe i solenergiapplikasjoner. Hver termisk lagringstiln\xe6rming har spesifikke krav ang\xe5ende temperaturniv\xe5, lagringsvarighet, strukturelle system, kostnader og lagringsmaterialeegenskaper blant andre. Det er vanligvis dannet av en eller flere tanker som inneholder lagringsmediet som smeltede salter, pakket lag eller vann under trykk. Kostnaden for TES varierer i funksjon av antall tanker, medium og plass okkupert, det varierer fra 200 til 500 NOK/kWh."},
gVj(){return"Historiske bygninger har ikke de samme teknologiske fordelene som nyere bygninger. Eldre bygninger ansl\xe5s \xe5 for\xe5rsake rundt 30 % av produksjonen av fast avfall og 35 % av forurensende utslipp. Ettersom disse bygningene bruker mer str\xf8m, er de ansvarlige for omtrent 39 % av verdens energiforbruk. Den europeiske union har som m\xe5l at 2050 skal v\xe6re en kliman\xf8ytral \xf8konomi. For \xe5 f\xe5 dette til m\xe5 vi produsere energi i rene former."},
gVk(){return"Norge f\xe5r mesteparten av sin elektrisitet fra vannkraft, men \xf8kende elektrisitetsbehov overg\xe5r vannkraftpotensialet. Andre fornybare kilder m\xe5 vurderes."},
