gXF(){return"I PPPP-modellen (People-Private-Public-Partnership) for finansiering samler privatpersoner, offentlig sektor og bedrifter inn den n\xf8dvendige summen. Midlene brukes til \xe5 kj\xf8pe et visst antall solcelleanlegg, hvorav noen prosenter eies av privatpersoner og resten av bedrifter. Inntektene fra de ulike solcelleanleggene vil deles forholdsmessig mellom aksjon\xe6rene, avhengig av hvor stor prosentandel de har bidratt med til crowdfundingen. Med dette felleseiet er ogs\xe5 vedlikeholdsansvaret delt. Eierne vil motta konsekvente forholdsmessige betalinger fra fortjenesten av den genererte kraften."},
gXG(){return"I denne finansieringsformen samler privatpersoner og det offentlige i fellesskap et visst bel\xf8p. Disse pengene brukes til \xe5 kj\xf8pe en viss mengde solcelleanlegg, som eies 100 % av privatpersoner. Inntektene fra de ulike solcelleanleggene vil deles proporsjonalt mellom personene, avhengig av prosentandelen de har bidratt med til crowdfundingen."},
gXH(){return"Innenfor leasingmodellen avtaler forbrukerne en tjenestekontrakt med en tjenesteleverand\xf8r. Dette selskapet leverer all teknologi, inkludert installasjon. De er ogs\xe5 ansvarlige for hele driften. Selskapet eier imidlertid alt utstyret. Kunder betaler et konstant m\xe5nedlig bel\xf8p til selskapet. Hele den \xf8konomiske risikoen og operasjonelle risikoen ligger hos tjenesteleverand\xf8ren"},
gXI(){return"En stor barriere som hindrer omfattende installasjon av solcellepaneler i M\xf8llenberg-omr\xe5det er finansiering. Den \xf8konomiske belastningen kan fordeles p\xe5 flere skuldre. I de f\xf8lgende modellene er ulike l\xf8sninger forklart n\xe6rmere. Offentlig og privat sektor b\xf8r ikke adresseres via en sak-til-sak-tiln\xe6rming, men b\xf8r adresseres direkte via en top-down-tiln\xe6rming p\xe5 tvers av hele omr\xe5det. Noen mulige finansieringsmodeller kan velges i nedtrekksmenyen. "},
