gYx(){return"Fredet bebyggelse utgj\xf8r majoriteten av M\xf8llenberg. De fleste bygningene har f\xe5tt \xe9n form for vernegrad som illustrert nedenfor. Byantikvaren, som skal gi r\xe5d om vern av kulturminner og kulturmilj\xf8er, har gjort en vurdering av bebyggelsen i Trondheim. I denne vurderingen er det opprettet tre beskyttelsesniv\xe5er fra A til C. Det st\xe5r ogs\xe5 hvilke omr\xe5der som skal klassifiseres som hensynsomr\xe5de (Trondheim kommune, 2021)."},
