gYz(){return"Trondheim Kommune publiserte i mars 2018 en veileder for bevaringsomr\xe5det. Form\xe5let med veilederen er \xe5 v\xe6re et hjelpemiddel for beboerne for \xe5 kunne oppn\xe5 best mulig forvaltning  av bygningsmassene. Hva som gjelder for fasadeendringer, er ogs\xe5 beskrevet for henholdsvis trebygninger og murbygninger. Overordnet sett skal det for alle bygninger tas vare p\xe5 de opprinnelige bygningsdelene og disse skal s\xe5 langt det lar seg gj\xf8re repareres. For trebygninger anbefaler byantikvaren at den opprinnelige kledningen blir tatt vare p\xe5. Den eldre kledningen er et trevirke av h\xf8y kvalitet og skal dermed s\xe5 langt det lar seg gj\xf8re bevares, dersom det m\xe5 skiftes skal det v\xe6re tilsvarende kledning. I tillegg skal alle fasadeendringer avklares med byantikvaren og s\xf8kes om til byggesakskontoret  (Byantikvaren, 2018)."},
gYA(){return"Tak skal beholdes slik de er og opprinnelig uttrykk og detaljering skal bevares. Ved eventuell utskifting av tak m\xe5 det benyttes samme tekkemateriale som det er p\xe5 bygning i dag, det kan ogs\xe5 byttes tilbake til opprinnelig tekkemateriale. Ved utbedring skal det eksisterende materialet relegges. Det er blant annet ikke mulig \xe5 etterisolere da dette kan endre byggets form og karakter. Endring av tekkemateriale m\xe5 ogs\xe5 avklares med byantikvaren og det skal s\xf8kes til byggesakskontoret (Byantikvaren, 2018)."},
