gYF(){return"Reguleringsplan for M\xf8llenberg er R0299 (Byantikvaren, 2018). R0299 inng\xe5r i veileder for fredning fra 1986 for M\xf8llenberg, Kirkesletten og Rosenborg. M\xe5let med veiledningen kan beskrives i fire niv\xe5er:"},
