gKM(){return"Med \xf8kte boligpriser og lavere kj\xf8pekraft har f\xe6rre innbyggere r\xe5d til \xe5 bli selveiere. Dette ekskluderer ogs\xe5 en h\xf8y andel av befolkningen fra den \xf8konomiske veksten i eiendomsmarkedet. Denne problemstillingen er ikke unik for Norge, men er en sentral sak i mange deler av verden. Effekten av dette kan v\xe6re \xf8kt deling av klasse og rikdom. M\xf8llenberg er et av de mest aktive og levende milj\xf8ene i Trondheim."},
