gKO(){return"Det er tre hovedcelletyper, monokrystallinsk, polykrystallinsk og tynnfilm."},
gKP(){return"Monocrystalline cells can be identified by their wafer shape and black or grey colouring. With 16 to 24%, they achieve the highest efficiency. However, due to their complex manufacturing process, they are also the most expensive."},
gKQ(){return"Polykrystallinske celler er ikke laget av en homogen barre, og de er billigere enn monokrystallinske. Den mindre perfekte krystallstrukturen senker imidlertid effektiviteten til polykrystallinske moduler til ca. 14 til 18%. De kan gjenkjennes av sin karakteristiske skinnende bl\xe5farge."},
gKR(){return"Tynnfilmceller kan lages av fotoaktive halvledermaterialer som amorft-basert silisium (a-Si), kadmiumtellurid (CdTe) eller kobberindiumdiselenid (CIS). Et veldig tynt lag av disse materialene p\xe5f\xf8res et rimelig underlag (f.eks. glass, metall eller plast). Tynnfilmceller kan b\xf8yes, og i sammenligning med monokrystallinske og polykrystallinske celler blir de ikke kuttet til _placeholder wafere. Dette gir flere muligheter i form og dimensjon og tillater kreativ bruk i arkitektur. Dessuten er celleeffektiviteten mindre avhengig av omgivelsestemperaturen. Ulempene med tynnfilmceller er en giftig produksjonsprosess og lavere effektivitet. Virkningsgraden varierer mellom 4 til 10 %."},
gCg(){return"Farget Modul"},
gKS(){return"En m\xe5te \xe5 integrere PV-moduler i bygninger p\xe5 en visuelt smakfull m\xe5te er \xe5 bruke fargede moduler. Hovedanvendelsesomr\xe5dene er fasader og tak, hvor modulene enten kan settes inn s\xe5 lite i\xf8ynefallende som mulig i eksisterende konstruksjoner eller bevisst brukes som et arkitektonisk designelement. P\xe5 denne m\xe5ten gir de muligheten til \xe5 \xf8ke aksepten for PV i kulturminner som M\xf8llenberg."},
gKT(){return"For \xe5 legge til farge p\xe5 en svart PV-modul, m\xe5 en del av det innfallende lyset reflekteres av modulen. Dette betyr at f\xe6rre fotoner er tilgjengelige for \xe5 generere elektrisitet, noe som senker effektiviteten til panelene. Det er forskjellige m\xe5ter \xe5 farge PV-moduler p\xe5. En av de vanligste teknikkene er bruk av enkelt- og flerlagsfilmer som reflekterer visse b\xf8lgelengder av synlig lys p\xe5 grunn av interferens og dermed skaper en farge. Andre muligheter er \xe5 trykke pigmenter p\xe5 dekkglasset eller \xe5 p\xe5virke spredning og absorpsjon."},
gKU(){return"For \xe5 sammenligne effektiviteten til forskjellige fargenyanser, m\xe5 de ha samme lysstyrke. Grunnen til dette er at lysere farger f\xf8rer til h\xf8yere reflektans, noe som \xf8ker det relative tapet av modulene. Forskere har funnet ut at gul-gr\xf8nne farger kan oppn\xe5 den h\xf8yeste effektiviteten. Dette er fordi det menneskelige \xf8yet er spesielt f\xf8lsomt for de tilsvarende b\xf8lgelengdene, og dermed trenger f\xe6rre fotoner \xe5 reflekteres for \xe5 fargelegges. Likevel er en teoretisk effektivitet p\xe5 mer enn 29 % mulig for alle sRGB-farger hvis de har en relativt lav lysstyrke."},
gKV(){return"Fotovoltaiske (PV) celler er enheter som kan konvertere solstr\xe5ling til likestr\xf8m. Ytelsen til PV-moduler avhenger av flere faktorer. Disse inkluderer st\xf8rrelsen, materialet og den elektriske effektiviteten til solcellene. I tillegg spiller ogs\xe5 klimatiske forhold en viktig rolle, da overskyethet og h\xf8ye temperaturer f\xf8rer til reduksjon i kraftuttaket."},
gCh(){return"Soltakstein"},
gKW(){return"Soltakstein kan brukes som erstatning for vanlig takstein og egner seg derfor spesielt godt til ny takkonstruksjon eller takrenovering. Det finnes solcelletakstein med forskjellige former, farger og PV-teknologier. Mono- eller polykrystallinske celler kan inkorporeres i flisen, s\xe5 vel som tynnfilmteknologier kan brukes p\xe5 flisene. Den vanlige effektiviteten er i omr\xe5det 10 til 15 %."},
gwV(){return"Gjennomsiktig PV"},
gKX(){return"De siste \xe5rene har det blitt forsket p\xe5 utvikling av transparente solceller. Disse gir muligheten til \xe5 bruke glassflater til elektrisitetsproduksjon. Spesielt for bygninger med store glassfasader kan solcellene gj\xf8re det mulig for bygningene \xe5 generere mer enn 40 % av energiforbruket selv. Imidlertid er \xe5penheten forel\xf8pig fortsatt forbundet med tap i effektivitet, og det er derfor de enn\xe5 ikke kan konkurrere med konvensjonelle silisiummoduler. Vanskeligheten med \xe5 produsere gjennomsiktige solceller er \xe5 muliggj\xf8re overf\xf8ring av synlig lys mens de absorberer fotoner i omr\xe5det av ikke-synlige b\xf8lgelengder. De fleste teknologier for produksjon av transparente solceller er basert p\xe5 tynnfilm PV. For dette form\xe5let avsettes et lag av en halvleder mindre enn 20 nm tykt p\xe5 glass. Dette reduserer gjennomsiktigheten til glasset med minst 20 %. Effektiviteten varierer fra 1 % til 10 % avhengig av \xe5penhet og produksjonsprosess."},
gKY(){return"Bakkegata best\xe5r i hovedsak av boligbebyggelse. Det er begrenset med plass mellom de ulike bygningene, og som f\xf8lge av dette blir mange av veggene ikke utsatt for sollys selv p\xe5 sommersolverv. DSH viser imidlertid ogs\xe5 at et par av takflatene opplever 14-20 direkte soltimer i samme periode."},
gKZ(){return"Bispehaugen er en barneskole omgitt av friarealer. P\xe5 grunn av dette mottar bygningen en god del sollys b\xe5de p\xe5 veggene 10-12 timer og taket 14-20 timer. P\xe5 den nord/vestlige delen av det valgte omr\xe5det ligger et boligkompleks som ogs\xe5 mottar i overkant av 20 direkte soltimer, f\xf8rst og fremst p\xe5 grunn av beliggenhet ved siden av Thorn\xe6s park."},
gL_(){return"Direkte soltimer M\xf8llenberg"},
gL0(){return"\xd8vre M\xf8llenberg ligger i den s\xf8rligste delen av distriktet. Ved siden av nabolaget ligger en stor park som inneholder Kristiansten fort. Det er \xe5pent terreng \xf8st for nabolaget, noe som trolig p\xe5virker soleksponeringen positivt. Best\xe5r hovedsakelig av enkeltbyggede boliger, de fleste av strukturene mottar en betydelig mengde soltimer spesielt p\xe5 takene, fra 14-20 timer, og p\xe5 veggene 0-12 timer."},
gL1(){return"Resultater av simuleringen viser at eksponeringen p\xe5 M\xf8llenberg varierer fra 20 timer p\xe5 det meste om sommeren til 4 timer om vinteren. Soltimefordelingen er jevn over hele distriktet, med et par ytterliggere, mot den s\xf8rlige delen av distriktet."},
gL2(){return"Rosenborg gate ligger i den nordlige delen av M\xf8llenberg og ligner p\xe5 Bakkegata. Veggene ser ut til \xe5 motta lite eller ingen sollys, mens noen av takflatene f\xe5r 20 timer med direkte sollys under sommersolverv."},
gL3(){return"Solstr\xe5ling og irradians"},
gL4(){return"Fotovoltaiske (PV) systemer konverterer irradians til brukbar elektrisitet. Bestr\xe5ling er et begrep som brukes for \xe5 beskrive styrken til den elektromagnetiske str\xe5lingen en overflate mottar. Den prim\xe6re faktoren som bestemmer irradiansstyrken er str\xe5lingsvinkelen for st\xf8t mot en overflate. Hvis en str\xe5le treffer en overflate med en innfallsvinkel p\xe5 90 grader, gir st\xf8tet maksimal energimengde. P\xe5 samme m\xe5te, hvis innfallsvinkelen er veldig skarp, vil solstr\xe5len reflektere overflaten, og derfor gi mindre energi (CE, u.d.)."},
